import React from 'react';
import { StyleSheet, Text, View, ScrollView, Image, SafeAreaView, StatusBar } from 'react-native';

const dishes = [
    { id: '1', name: 'Biriyani', image: 'data:image/jpeg;base64,' },
    { id: '2', name: 'Pizza', image: 'data:image/jpeg;base64,' },
    { id: '3', name: 'Burger', image: 'data:image/jpeg;base64,' },
    { id: '4', name: 'Fried Rice', image: 'data:image/jpeg;base64,' },
    { id: '5', name: 'Manchurian', image: 'data:image/jpeg;base64,' },
    { id: '6', name: 'Chowmein', image: 'data:image/jpeg;base64,' },
    { id: '7', name: 'Coke', image: 'data:image/jpeg;base64,' },
    { id: '8', name: 'Sprite', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTjoV8W-1oHD-u50FZVfrELBGOcab-RiqIs1A&s' },
    { id: '9', name: 'Thums Up', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaGORTFFLSoc-GoA_sl5JF9d6ynYhf2JFvTA&s' },
    
];

const Menu = () => {
    return (
        <SafeAreaView style={styles.safeArea}>
            <View style={styles.container}>
                <Text style={styles.title}>Menu</Text>
                <ScrollView contentContainerStyle={styles.scrollView}>
                    {dishes.map(dish => (
                        <View key={dish.id} style={styles.card}>
                            <Image source={{ uri: dish.image }} style={styles.image} />
                            <Text style={styles.dishName}>{dish.name}</Text>
                        </View>
                    ))}
                </ScrollView>
            </View>
        </SafeAreaView>
    );
}

export default Menu;

const styles = StyleSheet.create({
    safeArea: {
        flex: 1,
        backgroundColor: '#f5f5f7',
        paddingTop: StatusBar.currentHeight || 0,
    },
    container: {
        flex: 1,
        paddingHorizontal: 10,
    },
    title: {
        fontSize: 30,
        fontWeight: 'bold',
        marginBottom: 20,
        marginTop:20,
        marginLeft:10,
        color:'#023e8a'
    },
    scrollView: {
        paddingBottom: 20,
    },
    card: {
        flexDirection: 'row',
        alignItems: 'center',
        backgroundColor: '#fff',
        padding: 10,
        marginBottom: 10,
        borderRadius: 8,
        shadowColor: '#000',
        shadowOffset: { width: 0, height: 2 },
        shadowOpacity: 0.1,
        shadowRadius: 8,
        elevation: 2,
        marginHorizontal:7,
    },
    image: {
        width: 110,
        height: 80,
        borderRadius: 8,
        marginRight: 10,
        // resizeMode:'contain',
    },
    dishName: {
        fontSize: 18,
        fontWeight: '500',
        marginLeft:10,
    },
});
